import React, { Fragment } from 'react';
import Item from './Item.js'

const ListItems = ({itemsArr}) => {
    const itemComponent = itemsArr.map((i, index) => {
        i.length > 0 ? <Item key={index} itemValue={i}/> : null;
    })
    return (
        <Fragment>
            {itemComponent}
        </Fragment>
    )
}

export default ListItems;
